import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { supabase } from '../supabaseClient';
import { Container, Paper, Typography, Button, Box, Divider, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, CircularProgress, Rating, IconButton } from '@mui/material';
import StarIcon from '@mui/icons-material/Star';

function formatRupees(amount) {
  return amount ? amount.toLocaleString('en-IN', { style: 'currency', currency: 'INR' }) : '';
}

function Profile() {
  const [profile, setProfile] = useState(null);
  const [loading, setLoading] = useState(true);
  const [payments, setPayments] = useState([]);
  const [paymentsLoading, setPaymentsLoading] = useState(true);
  const [ratingLoading, setRatingLoading] = useState(null); // id of booking being rated
  const navigate = useNavigate();

  useEffect(() => {
    const fetchProfile = async () => {
      const {
        data: { session },
      } = await supabase.auth.getSession();
      if (!session?.user) {
        navigate('/login');
        return;
      }
      const { data, error } = await supabase
        .from('profiles')
        .select('*')
        .eq('id', session.user.id)
        .single();
      if (error) {
        setProfile(null);
      } else {
        setProfile(data);
      }
      setLoading(false);
    };
    fetchProfile();
  }, [navigate]);

  useEffect(() => {
    const fetchPayments = async () => {
      setPaymentsLoading(true);
      const {
        data: { session },
      } = await supabase.auth.getSession();
      if (!session?.user) return;
      const { data, error } = await supabase
        .from('payments')
        .select('*')
        .eq('user_id', session.user.id)
        .order('payment_date', { ascending: false });
      if (!error) setPayments(data || []);
      setPaymentsLoading(false);
    };
    fetchPayments();
  }, []);

  const handleRating = async (bookingId, value) => {
    setRatingLoading(bookingId);
    const { error } = await supabase
      .from('payments')
      .update({ rating: value })
      .eq('id', bookingId);
    if (!error) {
      setPayments(payments => payments.map(p => p.id === bookingId ? { ...p, rating: value } : p));
    }
    setRatingLoading(null);
  };

  if (loading) return <Typography>Loading...</Typography>;
  if (!profile) return <Typography>Profile not found.</Typography>;

  return (
    <Container maxWidth="md">
      <Box sx={{ mt: 8 }}>
        <Paper sx={{ p: 4 }}>
          <Typography variant="h5" gutterBottom>Profile</Typography>
          <Typography variant="body1"><b>Full Name:</b> {profile.full_name}</Typography>
          <Typography variant="body1"><b>Email:</b> {profile.email}</Typography>
          <Button sx={{ mt: 2 }} variant="contained" onClick={() => navigate('/')}>Back to Home</Button>
        </Paper>
        <Divider sx={{ my: 4 }} />
        <Paper sx={{ p: 3 }}>
          <Typography variant="h6" gutterBottom>Booking History</Typography>
          {paymentsLoading ? (
            <Box sx={{ display: 'flex', justifyContent: 'center', py: 3 }}>
              <CircularProgress />
            </Box>
          ) : payments.length === 0 ? (
            <Typography>No bookings found.</Typography>
          ) : (
            <TableContainer>
              <Table size="small">
                <TableHead>
                  <TableRow>
                    <TableCell>Name</TableCell>
                    <TableCell>Operator</TableCell>
                    <TableCell>From</TableCell>
                    <TableCell>To</TableCell>
                    <TableCell>Date</TableCell>
                    <TableCell>Price</TableCell>
                    <TableCell>Status</TableCell>
                    <TableCell>Paid On</TableCell>
                    <TableCell>Rating</TableCell>
                  </TableRow>
                </TableHead>
                <TableBody>
                  {payments.map((p) => (
                    <TableRow key={p.id}>
                      <TableCell>{p.name}</TableCell>
                      <TableCell>{p.operator}</TableCell>
                      <TableCell>{p.from}</TableCell>
                      <TableCell>{p.to}</TableCell>
                      <TableCell>{p.travel_date}</TableCell>
                      <TableCell>{formatRupees(p.amount)}</TableCell>
                      <TableCell>{p.status}</TableCell>
                      <TableCell>{new Date(p.payment_date).toLocaleString('en-IN')}</TableCell>
                      <TableCell>
                        <Rating
                          name={`rating-${p.id}`}
                          value={p.rating || 0}
                          precision={1}
                          icon={<StarIcon fontSize="inherit" color="warning" />}
                          emptyIcon={<StarIcon fontSize="inherit" color="disabled" />}
                          onChange={(_e, value) => handleRating(p.id, value)}
                          disabled={!!p.rating || ratingLoading === p.id}
                        />
                      </TableCell>
                    </TableRow>
                  ))}
                </TableBody>
              </Table>
            </TableContainer>
          )}
        </Paper>
      </Box>
    </Container>
  );
}

export default Profile;
